module.exports = /*#__PURE__*/JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","href":"/physical-ai-and-humanoid-robotics-book/","label":"Welcome","docId":"index","unlisted":false},{"type":"category","label":"Chapters","items":[{"type":"link","href":"/physical-ai-and-humanoid-robotics-book/chapters/chapter-1","label":"1. Introduction to Physical AI","docId":"chapters/chapter-1","unlisted":false},{"type":"link","href":"/physical-ai-and-humanoid-robotics-book/chapters/chapter-2","label":"2. The Robotic Nervous System – ROS 2","docId":"chapters/chapter-2","unlisted":false},{"type":"link","href":"/physical-ai-and-humanoid-robotics-book/chapters/chapter-3","label":"3. Digital Twins – Simulation with Gazebo & Unity","docId":"chapters/chapter-3","unlisted":false},{"type":"link","href":"/physical-ai-and-humanoid-robotics-book/chapters/chapter-4","label":"4. NVIDIA Isaac Platform – The AI Brain for Robots","docId":"chapters/chapter-4","unlisted":false},{"type":"link","href":"/physical-ai-and-humanoid-robotics-book/chapters/chapter-5","label":"5. Vision-Language-Action (VLA) Models","docId":"chapters/chapter-5","unlisted":false},{"type":"link","href":"/physical-ai-and-humanoid-robotics-book/chapters/chapter-6","label":"6. Humanoid Kinematics and Bipedal Locomotion","docId":"chapters/chapter-6","unlisted":false},{"type":"link","href":"/physical-ai-and-humanoid-robotics-book/chapters/chapter-7","label":"7. Dexterous Manipulation and Grasping","docId":"chapters/chapter-7","unlisted":false},{"type":"link","href":"/physical-ai-and-humanoid-robotics-book/chapters/chapter-8","label":"8. Sim-to-Real Transfer Techniques","docId":"chapters/chapter-8","unlisted":false},{"type":"link","href":"/physical-ai-and-humanoid-robotics-book/chapters/chapter-9","label":"9. Conversational Robotics & Natural Interaction","docId":"chapters/chapter-9","unlisted":false},{"type":"link","href":"/physical-ai-and-humanoid-robotics-book/chapters/chapter-10","label":"10. Capstone – Building an Autonomous Humanoid","docId":"chapters/chapter-10","unlisted":false}],"collapsed":true,"collapsible":true}]},"docs":{"chapters/chapter-1":{"id":"chapters/chapter-1","title":"Chapter 1: Introduction to Physical AI and Embodied Intelligence","description":"Welcome to the exciting world where artificial intelligence meets the physical realm. This chapter will introduce you to the core concepts of Physical AI and Embodied Intelligence, laying the groundwork for understanding how intelligent systems can interact with and learn from our physical world.","sidebar":"tutorialSidebar"},"chapters/chapter-10":{"id":"chapters/chapter-10","title":"Chapter 10: Capstone – Building an Autonomous Humanoid","description":"Congratulations! You\'ve journeyed through the foundational concepts of Physical AI, from understanding robotic nervous systems with ROS 2 and leveraging NVIDIA Isaac for simulation, to delving into vision-language-action models, humanoid kinematics, and dexterous manipulation. This capstone chapter brings all these elements together, outlining the grand challenge of building an autonomous humanoid robot and serving as a guide for your own ambitious projects.","sidebar":"tutorialSidebar"},"chapters/chapter-2":{"id":"chapters/chapter-2","title":"Chapter 2: The Robotic Nervous System – ROS 2 Deep Dive","description":"In the world of robotics, the Robot Operating System (ROS) acts as the central nervous system, providing libraries and tools to help software developers create robot applications. This chapter will take a deep dive into ROS 2, its architecture, core concepts, and how it facilitates the development of complex robotic systems.","sidebar":"tutorialSidebar"},"chapters/chapter-3":{"id":"chapters/chapter-3","title":"Chapter 3: Digital Twins – Simulation with Gazebo & Unity","description":"Building and testing robotic systems in the real world can be costly, time-consuming, and even dangerous. This is where digital twins and simulation environments become invaluable. In this chapter, we will explore the concept of digital twins and dive into two popular simulation platforms: Gazebo for realistic physics-based simulation and Unity for visually rich, high-fidelity environments.","sidebar":"tutorialSidebar"},"chapters/chapter-4":{"id":"chapters/chapter-4","title":"Chapter 4: NVIDIA Isaac Platform – The AI Brain for Robots","description":"To build truly intelligent and autonomous robots, powerful computational platforms are essential. NVIDIA\'s Isaac platform provides a comprehensive suite of tools, SDKs, and hardware acceleration to develop, simulate, and deploy AI-powered robots. This chapter will delve into the various components of the NVIDIA Isaac platform and how it serves as the AI brain for modern robotics.","sidebar":"tutorialSidebar"},"chapters/chapter-5":{"id":"chapters/chapter-5","title":"Chapter 5: Vision-Language-Action (VLA) Models","description":"To enable robots to truly understand and interact with the human world, they need to process information from multiple modalities – particularly vision and language – and translate that understanding into physical actions. This chapter introduces Vision-Language-Action (VLA) models, a cutting-edge approach that integrates perception, cognition, and action for more intelligent and adaptable robots.","sidebar":"tutorialSidebar"},"chapters/chapter-6":{"id":"chapters/chapter-6","title":"Chapter 6: Humanoid Kinematics and Bipedal Locomotion","description":"Humanoid robots, with their human-like form, represent a grand challenge in robotics. Enabling them to move gracefully and stably on two legs, and interact dexterously with the environment, requires a deep understanding of kinematics, dynamics, and advanced control strategies. This chapter will delve into the principles of humanoid kinematics and the complexities of bipedal locomotion.","sidebar":"tutorialSidebar"},"chapters/chapter-7":{"id":"chapters/chapter-7","title":"Chapter 7: Dexterous Manipulation and Grasping","description":"One of the ultimate goals in robotics is to enable machines to interact with the physical world with the same dexterity and precision as humans. This capability, known as dexterous manipulation and grasping, is crucial for robots to perform complex tasks in unstructured environments. This chapter will explore the challenges and techniques involved in enabling robots to grasp and manipulate objects with finesse.","sidebar":"tutorialSidebar"},"chapters/chapter-8":{"id":"chapters/chapter-8","title":"Chapter 8: Sim-to-Real Transfer Techniques","description":"Simulation offers an invaluable sandbox for developing and testing robotic systems, providing safety, speed, and cost-effectiveness. However, the ultimate goal is to deploy these systems in the real world. This transition, known as sim-to-real transfer, presents significant challenges due to the inevitable discrepancies between simulated and physical environments, often referred to as the \\"reality gap.\\" This chapter explores various techniques to bridge this gap and enable robust sim-to-real transfer.","sidebar":"tutorialSidebar"},"chapters/chapter-9":{"id":"chapters/chapter-9","title":"Chapter 9: Conversational Robotics & Natural Interaction","description":"The ability for robots to communicate and interact naturally with humans is paramount for their widespread adoption in daily life. Conversational robotics aims to bridge the gap between human language and robot action, enabling intuitive and effective collaboration. This chapter explores the principles of conversational AI in robotics, focusing on natural language understanding, dialogue management, and generating human-like responses.","sidebar":"tutorialSidebar"},"index":{"id":"index","title":"index","description":"Physical AI & Humanoid Robotics","sidebar":"tutorialSidebar"}}}}');

